### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Search Algorithms**
   - **Depth First Search (DFS)**
     - Explores as far as possible along each branch before backtracking.
     - Uses a stack (LIFO) to keep track of nodes.
   - **Breadth First Search (BFS)**
     - Explores all neighbors at the present depth before moving on to nodes at the next depth level.
     - Uses a queue (FIFO) to keep track of nodes.
   - **Best First Search**
     - Uses a priority queue to explore the most promising node first based on a given heuristic.
   - **Hill Climbing**
     - Iterative algorithm that starts with an arbitrary solution to a problem, then attempts to find a better solution by making an incremental change to the solution.
     - If the change produces a better solution, another incremental change is made to the new solution, and so on until no further improvements can be found.

2. **State Space Search**
   - Representing problems as states and transitions.
   - Safe and unsafe states.
   - Modeling problems like the river crossing puzzle.

3. **Simulated Annealing**
   - Probabilistic technique for approximating the global optimum of a given function.
   - Moves to a neighbor state with a probability that depends on the difference in the cost function and a temperature parameter.

4. **Traveling Salesman Problem (TSP)**
   - **Nearest Neighbor Heuristic**
     - Starts at a city and repeatedly visits the nearest city until all cities are visited.
   - **Greedy Heuristic**
     - Selects the next city based on the shortest distance without revisiting any city.
   - **Savings Heuristic**
     - Combines routes to maximize savings in distance.
   - **Path Representation**
     - Representing a tour as a sequence of cities.
   - **Adjacency Representation**
     - Representing a tour as a list of adjacent cities.
   - **Ordinal Representation**
     - Representing a tour using ordinal numbers.
   - **Partially Mapped Crossover (PMX)**
     - Genetic algorithm operator used to combine two parent tours to produce offspring tours.

5. **Graph Representation**
   - Nodes and edges.
   - Directed and undirected edges.
   - Manhattan distance for heuristic calculations.

#### Important Equations and Principles

1. **Manhattan Distance**
   - \( d(p, q) = |p_x - q_x| + |p_y - q_y| \)

2. **Simulated Annealing Probability**
   - \( P(\text{move}) = e^{-\frac{\Delta E}{T}} \)
   - Where \( \Delta E \) is the change in the cost function, and \( T \) is the temperature.

3. **Savings in TSP**
   - Savings \( s_{ij} = d_{i0} + d_{0j} - d_{ij} \)
   - Where \( d_{i0} \) is the distance from city \( i \) to the fulcrum node, \( d_{0j} \) is the distance from the fulcrum node to city \( j \), and \( d_{ij} \) is the distance from city \( i \) to city \( j \).

